  false,\n\t\"url\": null,\n\t\"notes\": \"The file geodatabase (fgdb) contains the
  New England Town Boundaries and information related specifically to the Resilience
  and Adaptation in New England (RAINE) web application. This includes data tables
  relating to particular aspects of towns notably features, funding, impacts, partners,
  plans, and programs (refer to V_MAP_STATIC tables). New England Town Boundary coverage
  is a compilation of coverages received from the six New England State GIS Offices.
  The EPA New England GIS Center appended the coverages together into a single file
  and generated attrributes to link to the Facility Identification Online system.
  These feature class points represent the communities (Communities in gdb) and featured
  RAINE communities (RAINE_Communities_201609), which contain more detailed information
  that is contained within the included data tables.\",\n\t\"license_title\": null,\n\t\"extras\":
